import { useEffect, useState } from "react";
import PortfolioList from "../portfolioList/PortfolioList";
import "./portfolio.scss"

export default function Portfolio() {
  const [selected,setSelected] = useState("featured");
  const list = [
    {
      id: "featured",
      title: "Featured",
    },
    {
      id: "web",
      title: "Web App",
    },
    {
      id: "mobile",
      title: "Mobile App",
    },
    {
      id: "design",
      title: "Design",
    },
    {
      id: "content",
      title: "Content",
    },
  ];


  return (
    <div className="portfolio" id="portfolio">
      <h1>Portfolio</h1>
      <ul>
        {list.map(item=>(
          <PortfolioList title={item.title} 
          active={ selected === item.id}
          setSelected = {setSelected}
          />
        ))}
      </ul>
      <div className="container">
        <div className="item">
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQsJWQY6rVgMFV6Zap6uriLpxc5twBuvSkf0g&usqp=CAU" alt="" />
          <h3>Banking</h3>
        </div>
        <div className="item">
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQsJWQY6rVgMFV6Zap6uriLpxc5twBuvSkf0g&usqp=CAU" alt="" />
          <h3>Banking</h3>
        </div>
        <div className="item">
          <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQsJWQY6rVgMFV6Zap6uriLpxc5twBuvSkf0g&usqp=CAU" alt="" />
